(def db (hdf5/open (<!? (-bget store #_#uuid "00e1f6f1-7d82-5560-8753-8b65cb08c74a" #uuid "038df595-a2a1-5e94-a870-f450cff0f49c" :file))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;affectionate-brook/db</span>","value":"#'affectionate-brook/db"}
;; <=

;; @@
(def joint-tensor (mat/matrix (hdf5/read  (hdf5/get-dataset db "/dist_joint_sim"))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;affectionate-brook/joint-tensor</span>","value":"#'affectionate-brook/joint-tensor"}
;; <=

;; @@
(hdf5/close db)
;; @@
